import React, {Component} from 'react'
import {NavLink} from 'react-router-dom'
import './Navigation.scss'
import '../../scss/settings/colors.scss'

class Navigation extends Component {
    render() {
        const selectedStyle = {
            border: "1px solid #FAD648"
        }

        const chosenStyle = {
            border: "1px solid #3C3C3C"
        }

        const greyStyle = {
            color: "#737373",
            textDecoration: "none"
        }

        const darkGreyStyle = {
            color: "#3C3C3C",
            textDecoration: "none"
        }
        return (
        <nav className="container">
            <ul className="login">
                <li><NavLink exact to="/logowanie" style={greyStyle} activeStyle={selectedStyle}>Zaloguj</NavLink></li>
                <li><NavLink exact to="/rejestracja" style={greyStyle} activeStyle={selectedStyle}>Załóż konto</NavLink></li>
            </ul>
            <ul className="menu">
                <li><NavLink exact to="/" style={darkGreyStyle} activeStyle={chosenStyle}>Start</NavLink></li>
                <li><NavLink exact to="/" style={darkGreyStyle} activeStyle={chosenStyle}>O co chodzi?</NavLink></li>
                <li><NavLink exact to="/" style={darkGreyStyle} activeStyle={chosenStyle}>O nas</NavLink></li>
                <li><NavLink exact to="/" style={darkGreyStyle} activeStyle={chosenStyle}>Fundacja i organizacje</NavLink></li>
                <li><NavLink exact to="/" style={darkGreyStyle} activeStyle={chosenStyle}>Kontakt</NavLink></li>
            </ul>
        </nav>
        )


    }
}

export default Navigation;
